INSERT INTO `about_us` (`id`, `title`, `description`, `image`, `video`, `created_at`, `updated_at`, `deleted_at`, `created_by`, `updated_by`, `deleted_by`) VALUES
(1, NULL, '<p><span style=\"font-size:14px\"><span style=\"font-family:Calibri,sans-serif\">সৃজনশীল প্রযুক্তির যথাযথ প্রয়োগ এবং তার সময়োচিত ব্যবহারই একটি দেশ এবং জাতির আর্থ-সামাজিক উন্নয়ন ও সমৃদ্ধি নিশ্চিত করতে পারে। গণপ্রজাতন্ত্রী বাংলাদেশ সরকারের মাননীয় প্রধানমন্ত্রী সেদিকে লক্ষ্য রেখেই তাঁর দিন বদলের নন্দিত সনদ &ldquo;রূপকল্প ২০৪১&rdquo; -এ গুরুত্বের সাথে &ldquo;ডিজিটাল বাংলাদেশ&rdquo; প্রতিষ্ঠার এক সুচিন্তিত এবং দূরদৃষ্টি সম্পন্ন কর্মসূচি অন্তর্ভুক্ত করেছেন। আমরা স্বপ্ন দেখি তথ্যপ্রযুক্তি ভিত্তিক বিকশিত একটি সমাজ ব্যবস্থা একদিন বাংলাদেশেও গড়ে উঠবে। তথ্যপ্রযুক্তির কার্যকর ও ফলপ্রসূ ব্যবহারের মাধ্যমে ডিজিটাল বাংলাদেশ অগ্রযাত্রায় আপনার ও আপনার প্রতিষ্ঠান পথিকৃত হয়ে থাকবে, প্রযুক্তি মনস্কতা ও কাঙ্খিত সচেতনতা সৃষ্টিতে ভূমিকা রাখবে এবং তথ্যপ্রযুক্তির বিস্তৃত পরিধির সাথে আপনাকে ও আপনার প্রতিষ্ঠানকে তথা বাংলাদেশকে আরও &nbsp;অনুপ্রাণিত ও সমৃদ্ধ করবে। ডিজিটাল বাংলাদেশ প্রতিষ্ঠায় আপনার প্রতিষ্ঠানে তথ্যপ্রযুক্তি সমন্নয়/উন্নয়ন করে একজন প্রজ্ঞাবান ও দায়িত্বশীল প্রতিনিধি হিসাবে এই প্রচেষ্টাকে এগিয়ে নিতে আপনার কার্যকর অংশগ্রহণ বিশেষভাবেই অগ্রগণ্য।</span></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:Calibri,sans-serif\">১৯৯৫ সালে কম্পিউটার ট্রেনিং নিয়ে শুরু হয় ডেস্কটপ আইটি&rsquo;র যাত্রা। ১৯৯৮ সালে ওয়েবসাইট ডেভেলপমেন্ট, সফটওয়ার ডেভেলপমেন্ট, ডোমেইন, হোস্টিং ইত্যাদি নিয়েও কাজ শুরু করি। ১৯৯৯ সালে কম্পিউটার সেলস ও সার্ভিসিং সংযুক্ত করি। এরপর ২০০১ সালে আমরা রাজশাহীতে প্রথম ব্রডব্যান্ড ইন্টারনেট সার্ভিস চালু করি। ২০০৪ সাল থেকে আমরা কর্পোরেট পর্যায়ে আইটি কনসালটেন্সি, সার্ভার ইন্সটলেশান, ল্যান ও ওয়ান নেটওয়ার্কিং, সিসিটিভি/আইপি ক্যামেরা, আইপি পিবিএক্স এবং স্পেশালাইজড ট্রেনিং নিয়ে কাজ করে যাচ্ছি। আমরা এ্যাকসেস কন্ট্রোল ও সিকিউরিটি ডিভাইস এবং অফিস ও বাসা স্মার্ট অটোমেশন নিয়ে কাজ করছি। বারকোড ও স্মার্ট আইডি কার্ড প্রিন্ট করি। আর্কাইভস ও ডিজিটাল আর্কাইভস নিয়ে আমরা কাজ করে আসছি ২০০৭ সাল থেকে। আমাদের রয়েছে পাবলিকেশন, আমরা বিভিন্ন প্রতিষ্ঠানের স্মরণিকা প্রকাশ করি। ঢাকা, রাজশাহী, চট্টগ্রামের পর ভারতের কলকাতায় এবং আমেরিকাতেও আমাদের অফিস রয়েছে, প্রায় ১০টি দেশে আমাদের সেবা কার্যক্রম চালু রয়েছে এবং আউটসোর্সিং সার্ভিস দিয়ে বৈদেশিক মুদ্রা অর্জন করছি।</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:Calibri,sans-serif\">ডেস্কটপ আইটির নতুন সংযোজন&nbsp; <a href=\"https://theexamly.com/\" style=\"color:#0563c1; text-decoration:underline\">theExamly.com</a> অনলাইনে অনুশীলনের একটি দুর্দান্ত সমাধান, কারণ আমাদের রয়েছে চাকুরীর জন্য বিসিএস প্রিলিমিনারি, সরকারী চাকুরী, প্রাইমারি শিক্ষক নিয়োগ, স্কুল-কলেজ-মাদ্রাসার শিক্ষক নিবন্ধন, মেডিকেল / ইঞ্জিনিয়ারিং / কৃষি বিশ্ববিদ্যালয় সহ সকল পাবলিক বিশ্ববিদ্যালয়ের পরীক্ষা এবং পাবলিক পরীক্ষা যেমন- এস এস সি ও এইচ এস সি পরীক্ষাগুলির জন্য অসংখ্য প্রশ্নের বৃহৎ সুবিন্যস্ত ডাটাবেস সমৃদ্ধ সিস্টেম। আমাদের মূল উদ্দেশ্য হলো যে কোনো পরীক্ষায় প্রস্তুতির জন্য শিক্ষার্থীদের অসংখ্য প্রশ্ন অধ্যয়নের এবং বারবার মডেল টেস্ট পরীক্ষায় অংশ গ্রহণ করার সুযোগ, যেন শিক্ষার্থীরা নিজেদেরকে অধিক সমৃদ্ধ করতে এবং স্বপ্ন বাস্তবায়ন এর ক্ষেত্রে নিজকে বহুদুর এগিয়ে নিয়ে যেতে পারে।<br />\r\n&nbsp;&nbsp;<br />\r\n<a href=\"https://theexamly.com/\" style=\"color:#0563c1; text-decoration:underline\">theExamly.com</a>&nbsp;এমন একটা প্লাটফর্ম যার মাধ্যমে শিক্ষার্থীরা নিজের বাসায় বসে যে কোনো সময় যে কোন ডিভাইস দিয়ে অভিজ্ঞ শিক্ষকদের দ্বারা তৈরীকৃত প্রশ্ন পত্রের মাধ্যমে নিজেকে যাচাই করে নিতে পারবে। একমাত্র আমরাই দিচ্ছি খুবই স্বল্প মূল্যে অধ্যয়ন সহ অসংখ্য মডেল টেস্টে অংশগ্রহণের সুযোগ। আজই আমাদের সিস্টেমে রেজিস্ট্রেশন করে বেছে নিন আপনার পছন্দের প্রস্তুতি পরীক্ষাটি।<br />\r\n&nbsp;<br />\r\nআমরা আত্মবিশ্বাসের সাথে বলতে পারি যে&nbsp;<a href=\"https://theexamly.com/\" style=\"color:#0563c1; text-decoration:underline\">theExamly.com</a>&nbsp;আসল সাফল্যের সন্ধানকারীর জন্য সেরা এবং খুব সাশ্রয়ী মূল্যের সমাধান।</span></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:Calibri,sans-serif\">&nbsp;</span></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:Calibri,sans-serif\">বাংলাদেশ কম্পিউটার সমিতি, মেম্বারশিপ নংঃ ২৩২৪</span></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:Calibri,sans-serif\">বেসিস মেম্বারশিপ নংঃ GE-21-02-0016</span></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:Calibri,sans-serif\">ই-ক্যাব মেম্বারশিপ নংঃ ১৫৩৬</span></span></p>', '1656562910.png', '', '2021-03-31 08:31:57', '2022-06-30 04:21:51', NULL, 1, 112, NULL);
