INSERT INTO `blogs` (`id`, `title`, `description`, `status`, `image`, `created_at`, `updated_at`, `deleted_at`, `created_by`, `updated_by`, `deleted_by`) VALUES
(5, 'বাংলাদেশ স্থলবন্দর কর্তৃপক্ষ নিয়োগ বিজ্ঞপ্তি - ২০২২', '<p><span style=\"font-size:11pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"font-size:16.0pt\"><span style=\"font-family:SolaimanLipi\">জনবল নিয়োগের বিজ্ঞপ্তি প্রকাশ করেছে বাংলাদেশ স্থলবন্দর কর্তৃপক্ষ। বাংলাদেশ স্থলবন্দর কর্তৃপক্ষ ০৩ টি পদে মোট ৩৮ জনকে নিয়োগ দিবে। এই পদগুলোতে নারী ও পুরুষ উভয়েই আবেদন করতে পারবেন। আগ্রহী প্রার্থীগণ যোগ্যতা অনুসারে অনলাইনে আবেদন করতে পারবেন। সম্পূর্ণ বিজ্ঞপ্তি বিস্তারিত দেওয়া হল।</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><strong><span style=\"font-size:22.0pt\"><span style=\"font-family:SolaimanLipi\">Bangladesh Land Port Authority job Circular 2022</span></span></strong></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><strong><span style=\"font-size:16.0pt\"><span style=\"font-family:SolaimanLipi\">প্রতিষ্ঠানের নাম: বাংলাদেশ স্থলবন্দর কর্তৃপক্ষ</span></span></strong></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><strong><span style=\"font-size:16.0pt\"><span style=\"font-family:SolaimanLipi\">পদের নাম: ওয়্যারহাউজ/ইয়ার্ড সুপারিনটেনডেন্ট</span></span></strong><br />\r\n<span style=\"font-size:16.0pt\"><span style=\"font-family:SolaimanLipi\">পদ সংখ্যা: ৩৬ টি।<br />\r\nশিক্ষাগত যোগ্যতা: স্নাতক ডিগ্রি।<br />\r\nবেতন স্কেল: ১১,০০০-২৬,৫৯০ টাকা।</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><strong><span style=\"font-size:16.0pt\"><span style=\"font-family:SolaimanLipi\">পদের নাম: ক্যাশিয়ার</span></span></strong><br />\r\n<span style=\"font-size:16.0pt\"><span style=\"font-family:SolaimanLipi\">পদ সংখ্যা: ০১ টি।<br />\r\nশিক্ষাগত যোগ্যতা: স্নাতক ডিগ্রি।<br />\r\nবেতন স্কেল: ১০,২০০-২৪,৬৮০ টাকা।</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><strong><span style=\"font-size:16.0pt\"><span style=\"font-family:SolaimanLipi\">পদের নাম: মেডিকেল এটেনডেন্ট</span></span></strong><br />\r\n<span style=\"font-size:16.0pt\"><span style=\"font-family:SolaimanLipi\">পদ সংখ্যা: ০১ টি।<br />\r\nশিক্ষাগত যোগ্যতা: এইচএসসি পাশ।<br />\r\nবেতন স্কেল: ৯,৭০০-২৩,৪৯০ টাকা।</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><strong><span style=\"font-size:16.0pt\"><span style=\"font-family:SolaimanLipi\">আবেদনের নিয়ম:</span></span></strong><span style=\"font-size:16.0pt\"><span style=\"font-family:SolaimanLipi\">&nbsp;আবেদন করতে হবে অনলাইনে&nbsp;<a href=\"http://bsbk.teletalk.com.bd/\" target=\"_blank\"><span style=\"color:blue\">http://bsbk.teletalk.com.bd</span></a>&nbsp;ওয়েবসাইটের মাধ্যমে।</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><strong><span style=\"font-size:16.0pt\"><span style=\"font-family:SolaimanLipi\">আবেদন শুরুর সময়:</span></span></strong><span style=\"font-size:16.0pt\"><span style=\"font-family:SolaimanLipi\"> ০৭ জুলাই ২০২২ তারিখ সকাল ১০:০০ টা থেকে আবেদন করা যাবে।<br />\r\n<strong>আবেদনের শেষ সময়:</strong> ০৬ আগষ্ট ২০২২ তারিখ বিকাল ০৫:০০ টা পর্যন্ত আবেদন করা যাবে।</span></span></span></span></p>', 0, 'default.jpg', '2022-07-07 08:34:37', '2022-07-07 08:44:43', '2022-07-07 08:44:43', 112, 112, 112);
