INSERT INTO `features` (`id`, `title`, `description`, `image`, `status`, `created_at`, `updated_at`, `deleted_at`, `created_by`, `updated_by`, `deleted_by`) VALUES
(1, 'ফিচার সমূহঃ', '<p>১. &nbsp;দেশের সেরা শিক্ষক ও অভিজ্ঞ ব্যক্তিবর্গের দ্বারা তৈরিকৃত প্রশ্নে মডেল টেস্ট দেওয়ার সুযোগ ।</p>\r\n\r\n<p>২. &nbsp;স্বল্প খরচে অসংখ্য প্রাকটিস পরীক্ষা এবং সর্বাধিক মডেল টেস্ট দেওয়ার ব্যবস্থা ।</p>\r\n\r\n<p>৩. &nbsp;সরকারি নির্দেশাবলী এবং সাম্প্রতিক সিলেবাস অনুসরণ করে মডেল টেস্ট প্রস্তুত করা হচ্ছে ।</p>\r\n\r\n<p>৪. &nbsp;প্রতিদিন&nbsp;<strong><a href=\"http://theexamly.com/\">theExamly.com</a></strong>&nbsp;এ নতুন তথ্য/প্রশ্নপত্র সংযোজন করা হচ্ছে ।</p>\r\n\r\n<p>৫. &nbsp;প্রত্যেক শিক্ষার্থী মডেল টেস্ট দেওয়ার সাথে সাথে নিজের গ্রেড ও মেরিট লিস্ট দেখতে পারবে ।</p>\r\n\r\n<p>৬. &nbsp;যে কোন পরীক্ষায় নিজেকে নিজে মূল্যায়নের জন্য রয়েছে সকল আয়োজন ।</p>\r\n\r\n<p>৭. &nbsp;সর্বাধিক প্রশ্ন সম্বলিত বহুনির্বাচনী, সৃজনশীল ও লিখিত পরীক্ষার ব্যবস্থা ।</p>\r\n\r\n<p>৮. &nbsp;কোচিং নির্ভরশীলতা কমিয়ে সময় ও অর্থ সাশ্রয় সহ সাফল্যের পথ দেখাচ্ছে ।</p>\r\n\r\n<p>৯. &nbsp;অধ্যয়নরত ছাত্র-ছাত্রীদের শিক্ষার পাশাপাশি চাকুরি প্রত্যাশীদের জন্যও সহায়ক ভূমিকা রাখছে ।</p>\r\n\r\n<p>১০.&nbsp;<strong><a href=\"http://theexamly.com/\">theExamly.com</a></strong>&nbsp;দিচ্ছে সময় ও অর্থ সাশ্রয় সহ সাফল্যের শতভাগ নিশ্চয়তা ।</p>', '1656562980.png', 1, '2021-04-12 07:56:27', '2022-06-30 04:23:00', NULL, 1, 112, 1);
