(11, '<h1><strong><span style=\"font-size:18px\">বিসিএস প্রিলিমিনারি পরীক্ষায় অংশগ্রহণকারীদের জন্য জরুরি নির্দেশনা প্রকাশ</span></strong></h1>\r\n\r\n<p>১. পরীক্ষা-২০২০ এর প্রকাশিত বিজ্ঞপ্তির শর্তানুযায়ী আগামী ২৯ নভেম্বর অনুষ্ঠেয় প্রিলিমিনারি টেস্টের পরীক্ষা কেন্দ্রে বই-পুস্তক, সকল প্রকার ঘড়ি, মোবাইল ফোন, ক্যালকুলেটর, সকল ধরনের ইলেকট্রনিক ডিভাইস, ব্যাংক/ক্রেডিট কার্ড সদৃশ কোন ডিভাইস, গহনা, ব্রেসলেট ও ব্যাগ আনা সম্পূর্ণ নিষিদ্ধ। কোন প্রার্থী নিষিদ্ধ সামগ্রীসহ পরীক্ষা কেন্দ্রে প্রবেশ করতে পারবেন না।</p>\r\n\r\n<p>২. পরীক্ষা কেন্দ্রের গেটে এক্সিকিউটিভ ম্যাজিস্ট্রেট-পুলিশের উপস্থিতিতে প্রবেশপত্র এবং মেটাল ডিটেক্টরের সাহায্যে মোবাইল ফোন, ঘড়ি, ইলেকট্রনিক ডিভাইসসহ নিষিদ্ধ সামগ্রী তল্লাশির মধ্য দিয়ে প্রার্থীদের পরীক্ষা কেন্দ্রে প্রবেশ করতে হবে।</p>\r\n\r\n<p>৩. পরীক্ষার দিন উল্লিখিত নিষিদ্ধ সামগ্রী সাথে না আনার জন্য সকল প্রার্থীর মোবাইল ফোনে এসএমএস প্রেরণ করা হবে। এসএমএস বার্তার নির্দেশনা অনুসরণ করতে হবে।</p>\r\n\r\n<p>৪. পরীক্ষার সময় প্রার্থীবৃন্দ কানের ওপর কোন আবরণ রাখবেন না, কান খোলা রাখতে হবে। কানে কোন ধরনের হিয়ারিং এইড ব্যবহারের প্রয়োজন হলে বিশেষজ্ঞ ডাক্তারের পরামর্শপত্রসহ পূর্বাহ্নে কমিশনের অনুমোদন গ্রহণ করতে হবে।</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>৫. পরীক্ষার কেন্দ্রে কোন প্রার্থীর নিকট বর্ণিত নিষিদ্ধ সামগ্রী পাওয়া গেলে তা বাজেয়াপ্তসহ বাংলাদেশ সিভিল সার্ভিস (বয়স, যোগ্যতা ও সরাসরি নিয়োগের জন্য পরীক্ষা) বিধিমালা ২০১৪-এর বিধি ভঙ্গের কারণে সংশ্লিষ্ট প্রার্থীর প্রার্থিতা বাতিলসহ ভবিষ্যতে কর্ম কমিশন কর্তৃক গৃহীতব্য সকল নিয়োগ পরীক্ষার জন্য উক্ত প্রার্থীকে অযোগ্য ঘোষণা করা হবে।</p>', '', 0, '2021-10-14 05:33:22', '2021-10-26 11:31:48', NULL, 1, 1, NULL),
(12, NULL, '1655809140-examly-flyer-5.png', 0, '2022-06-21 10:59:01', '2022-06-21 10:59:01', NULL, 112, NULL, NULL);
