INSERT INTO `privacy_policies` (`id`, `description`, `created_at`, `updated_at`, `deleted_at`, `created_by`, `updated_by`, `deleted_by`) VALUES
(1, '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:SolaimanLipi\"><a href=\"https://theexamly.com/\" style=\"color:#0563c1; text-decoration:underline\"><strong>theExamly.com</strong></a>&nbsp;</span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">ওয়েবসাইট</span></span> <span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">ও</span></span> <span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">অ্যাপ</span></span><span style=\"font-family:SolaimanLipi\">, </span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">ডেস্কটপ আইটির একটি ব্যবসায়িক বিভাগ</span></span><span style=\"font-family:SolaimanLipi\">, </span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">এই ওয়েবসাইট ব্যবহারকারীদের সমস্ত তথ্যের গোপনীয়তা</span></span><span style=\"font-family:SolaimanLipi\">, </span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">অখণ্ডতা এবং সুরক্ষা বজায় রাখতে আমরা প্রতিশ্রুতিবদ্ধ। এই প্রাইভেসি পলিসি</span></span><span style=\"font-family:SolaimanLipi\">, </span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">ওয়েবসাইট ব্যবহারের সময় আপনার কাছ থেকে সংগ্রহকৃত নির্দিষ্ট কোন তথ্য কিভাবে ব্যবহার করবে তা বর্ণনা করে। আমরা আপনার কাছ থেকে কি</span></span>&nbsp; <span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">ধরণের</span></span> <span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">তথ্য</span></span> <span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">সংগ্রহ</span></span> <span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">করতে পারি</span></span><span style=\"font-family:SolaimanLipi\">, </span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">আমাদের ওয়েবসাইটের মাধ্যমে প্রদত্ত সেবাগুলোর সাথে কিভাবে সেই তথ্য ব্যবহার করা হবে এবং কিভাবে তথ্যটি আমাদের ব্যবসায়িক অংশীদারদের জানানো হবে সে সম্পর্কে বিস্তারিত জানার জন্য অনুগ্রহপূর্বক নিচের লেখাগুলো পড়ুন।</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">&nbsp;</span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">এই প্রাইভেসি পলিসিটি আমাদের বর্তমান এবং প্রাক্তন অনলাইন গ্রাহক এবং ওয়েবসাইট ভিজিটরদের জন্য প্রযোজ্য। আমাদের ওয়েবসাইট পরিদর্শন</span></span>&nbsp;<span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">অথবা ব্যবহার ক</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">রা মানে</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\"> আপনি এই প্রাইভেসি পলিসিতে সম্মতি জানাচ্ছেন। ওয়েবসাইট ব্যবহার করে অথবা ওয়েবসাইট এ রেজিস্ট্রেশন করে আপনি ডেস্কটপ আইটি এবং এর প্রতিনিধি</span></span><span style=\"font-family:SolaimanLipi\">, </span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">সহযোগী এবং এর ব্যবসায়িক অংশীদারদের কে ইমেইল বা ফোন কল বা এসএমএসের মাধ্যমে আপনার সাথে যোগাযোগ করতে এবং আপনাকে সার্ভিস সম্পর্কে কোন</span></span> <span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">ত</span></span><span style=\"font-family:SolaimanLipi\">থ্য,&nbsp;<a href=\"https://theexamly.com/\" style=\"color:#0563c1; text-decoration:underline\"><strong>theExamly.com</strong></a>&nbsp;</span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">এর প্রচারমূলক অফার এবং</span></span>&nbsp;<span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">এর ব্যবসায়িক অংশীদার</span></span><span style=\"font-family:SolaimanLipi\">, এছাড়া </span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">তৃতীয় পক্ষের দ্বারা কোন অফার নিয়ে যোগাযোগ করতে</span></span><span style=\"font-family:SolaimanLipi\">, </span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">আপনার বিস্তারিত তথ্য সংগ্রহ করার অনুমতি প্রদান করছেন। এই ক্ষেত্রে</span></span><span style=\"font-family:SolaimanLipi\">, </span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">আপনার অ্যাকাউন্টটি আপনার বা আমাদের দ্বারা নিষ্ক্রিয় করার পরেও আপনার অনুমোদন বলবত থাকবে।</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">&nbsp;</span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">ব্যক্তিগত তথ্য নিয়ন্ত্রণকারী</span></span></strong></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">আপনার ব্যক্তিগত তথ্য</span></span><span style=\"font-family:SolaimanLipi\">&nbsp;<a href=\"https://theexamly.com/\" style=\"color:#0563c1; text-decoration:underline\"><strong>theExamly.com</strong></a>&nbsp;</span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">এবং ডেস্কটপ আইটি সংগ্রহ</span></span>&nbsp;<span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">এবং সংরক্ষণ করবে।</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">&nbsp;</span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">আপনার তথ্য সংগ্রহের উদ্দেশ্য</span></span></strong></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">যখন আপনি আমাদের ওয়েবসাইটে রেজিস্ট্রেশন করেন</span></span><span style=\"font-family:SolaimanLipi\">, </span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">যখন আপনি আমাদের কোন</span></span>&nbsp;<span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">পরীক্ষা ক্রয় করেন</span></span><span style=\"font-family:SolaimanLipi\">, </span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">কিংবা আমাদের ওয়েবসাইট ভিজিট করেন</span></span><span style=\"font-family:SolaimanLipi\">&nbsp;<a href=\"https://theexamly.com/\" style=\"color:#0563c1; text-decoration:underline\"><strong>theExamly.com</strong></a>&nbsp;</span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">আপনার তথ্য সংগ্রহ করে । আপনি</span></span><span style=\"font-family:SolaimanLipi\">&nbsp;<a href=\"https://theexamly.com/\" style=\"color:#0563c1; text-decoration:underline\"><strong>theExamly.com</strong></a>&nbsp;</span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">এ </span></span><span style=\"font-family:SolaimanLipi\">রেজিষ্টার</span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\"> করার সময় আপনাকে এমন কিছু তথ্য জমা দেওয়ার জন্য বলা হবে যা আপনার ব্যক্তিগত হতে পারে যেমন </span></span><span style=\"font-family:SolaimanLipi\">আপনার নাম, </span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">মোবাইল নম্বর</span></span><span style=\"font-family:SolaimanLipi\">, </span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">ই-মেইল ইত্যাদি। একবার আমাদের ওয়েবসাইটে </span></span><span style=\"font-family:SolaimanLipi\">রেজিষ্টার</span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\"> করে </span></span><span style=\"font-family:SolaimanLipi\">লগ </span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">ইন করলে আপনি আমাদের কাছে আর অজ্ঞাতনামা থাকবেন না। এছাড়াও</span></span><span style=\"font-family:SolaimanLipi\">, </span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">আপনাকে</span></span> <span style=\"font-family:SolaimanLipi\">রেজিষ্ট্রেশনের</span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\"> সময় আপনার যোগাযোগের নম্বর দিতে বলা হবে এবং আপনার ওয়্যারলেস ডিভাইসে আমাদের সার্ভিস সম্পর্কিত এসএমএস</span></span><span style=\"font-family:SolaimanLipi\">, </span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">বিজ্ঞপ্তি প্রেরণ করতে পারবো। অতএব</span></span><span style=\"font-family:SolaimanLipi\">, রেজিষ্টার</span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\"> করে আপনি</span></span><span style=\"font-family:SolaimanLipi\">&nbsp;<a href=\"https://theexamly.com/\" style=\"color:#0563c1; text-decoration:underline\"><strong>theExamly.com</strong></a>&nbsp;</span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">কে অনুমতি দিচ্ছেন আপনার লগইন তথ্য ব্যবহার করে আপনাকে এস এম এস</span></span><span style=\"font-family:SolaimanLipi\">, ফোন কল, </span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">ই-মেইল এলার্ট প্রেরণ</span></span><span style=\"font-family:SolaimanLipi\">, </span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">প্রচারমূলক ই-মেইল এবং এসএমএস সহ অন্যান্য সেবার প্রয়োজনীয়তা সম্পর্কে আপনার সাথে যোগাযোগ করতে।</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">&nbsp;</span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">আমরা আপনার তথ্য ব্যবহার করে থাকি:</span></span></strong></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">১. আপনার প্রশ্নের বা অনুরোধের জবাব দেয়ার জন্য।</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">২. আপনার অর্ডার বা অ্যাপ্লিকেশন প্রসেস করার জন্য।</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">৩. নতুন আরও</span></span>&nbsp;<span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">বিজ্ঞাপন </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">জানানোর</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\"> জন্য।</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">&nbsp;</span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">আমরা কুকিজ সংগ্রহ করি</span></span></strong></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">একটি কুকি</span></span><span style=\"font-family:SolaimanLipi\">,</span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\"> ব্যবহারকারীর কম্পিউটারে সঞ্চিত আংশিক ডাটা যা ব্যবহারকারীর সম্পর্কে তথ্যের সাথে সম্পৃক্ত। আমরা সেশন আইডি কুকি এবং পারসিস্টেন্ট কুকি উভয় ব্যবহার করতে পারি। সেশন আইডি কুকিজের জন্য আপনি একবার নিজের ব্রাউজারটি বন্ধ করে দিলে বা লগ আউট করলে কুকিটি বন্ধ হয়ে যায় এবং মুছে যায়। একটি পারসিস্টেন্ট কুকি একটি ছোট্ট টেক্সট ফাইল যা আপনার কম্পিউটারের হার্ড ড্রাইভে নির্দিষ্ট সময়ের জন্য সঞ্চিত থাকে। ব্যবহারকারী ওয়েবসাইটটি দেখার সময় সেশন আইডি কুকিগুলি দ্বারা ব্যবহারকারীর পছন্দগুলি অনুসরণ করতে ব্যবহার করা হয়। এগুলি লোডের সময়কে হ্রাস করতে এবং সার্ভার প্রক্রিয়াজাতকরণে সঞ্চয় করতে সহায়তা করে। পারসিস্টেন্ট কুকিগুলি দ্বারা আপনি নিজের পাসওয়ার্ড মনে রাখতে চান কিনা এবং অন্যান্য তথ্য চান কিনা তা জানা যায়।</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">&nbsp;</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">লগ ফাইল</span></span></strong></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">বেশিরভাগ স্ট্যান্ডার্ড ওয়েবসাইটের মতো আমরা লগ ফাইল ব্যবহার করি। এই তথ্যগুলির মধ্যে ইন্টারনেট প্রোটোকল (আইপি) ঠিকানা</span></span><span style=\"font-family:SolaimanLipi\">, </span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">ব্রাউজারের ধরণ</span></span><span style=\"font-family:SolaimanLipi\">, </span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">ইন্টারনেট পরিষেবা সরবরাহকারী (আইএসপি)</span></span><span style=\"font-family:SolaimanLipi\">, </span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">রেফারিং / প্রস্থান পৃষ্ঠাগুলি</span></span><span style=\"font-family:SolaimanLipi\">, </span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">প্ল্যাটফর্মের ধরণ</span></span><span style=\"font-family:SolaimanLipi\">, </span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">তারিখ / সময় স্ট্যাম্প এবং প্রবণতা বিশ্লেষণ করতে সাইটগুলির এডমিনিস্ট্রেটিভ</span></span><span style=\"font-family:SolaimanLipi\">, </span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">ব্যবহারকারীর গতিবিধি ট্র্যাক করার জন্য ক্লিকের সংখ্যা অন্তর্ভুক্ত থাকতে পারে এবং সামগ্রিক ব্যবহারের জন্য </span></span><span style=\"font-family:SolaimanLipi\">বিস্তৃত&nbsp;</span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">জনসংখ্যার তথ্য সংগ্রহ করা হয়ে থাকে। আপনার সম্পর্কে সংগ্রহ করা অন্যান্য তথ্যের সাথে আমরা স্বয়ংক্রিয়ভাবে সংগৃহীত লগ তথ্যটি একত্রিত করতে পারি। বিপণন</span></span><span style=\"font-family:SolaimanLipi\">, </span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">বিশ্লেষণ বা সাইটের কার্যকারিতার পাশাপাশি আমরা আপনাকে যে সার্ভিসগুলি অফার করি সেগুলি উন্নত করতে আমরা এই কাজটি করে থাকি।</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">&nbsp;</span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">নিরাপত্তা</span></span></strong></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">আপনার কাছ থেকে সংগৃহীত তথ্য সুরক্ষার জন্য আমরা যথাযথ প্রযুক্তিগত এবং সাংগঠনিক নিরাপত্তা ব্যবস্থা সর্বদা ব্যবহার করি। আমরা অননুমোদিত বা অবৈধ ব্যবহার বা তথ্যের পরিবর্তনের বিরুদ্ধে এবং কোনও দুর্ঘটনাজনিত ক্ষতি</span></span><span style=\"font-family:SolaimanLipi\">, </span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">ধ্বংস</span></span><span style=\"font-family:SolaimanLipi\">, </span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">বা তথ্যের ক্ষতির বিরুদ্ধে একাধিক পদ্ধতি এবং সুরক্ষা ব্যবস্থা ব্যবহার করি। তবে ইন্টারনেটের মাধ্যমে ট্রান্সমিশনের কোনও পদ্ধতি বা স্টোরেজ পদ্ধতি </span></span><span style=\"font-family:SolaimanLipi\">100% </span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">নিরাপদ নয়। অতএব</span></span><span style=\"font-family:SolaimanLipi\">, </span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">আমরা এর নিখুঁত সুরক্ষার গ্যারান্টি দিতে পারি না। আপনি আপনার লগইন আইডি এবং পাসওয়ার্ডের গোপনীয়তা এবং সুরক্ষা বজায় রাখার জন্য দায়বদ্ধ এবং কোনও তৃতীয় পক্ষকে এই তথ্যগুলো সরবরাহ করবেন না।</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">&nbsp;</span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">তৃতীয় পক্ষের বিজ্ঞাপন</span></span></strong></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">আপনি যখন আমাদের ওয়েবসাইট ভিজিট করেন তখন বিজ্ঞাপনগুলি দেখানোর জন্যে আমরা তৃতীয় পক্ষের অর্থাৎ বিজ্ঞাপন সংস্থা অথবা বিজ্ঞাপন এজেন্সিগুলি ব্যবহার করতে পারি। এই সংস্থাগুলি আপনার আগ্রহের বিষয় হতে পারে এমন পণ্য এবং পরিষেবাদি সম্পর্কিত বিজ্ঞাপন এই ওয়েবসাইটে প্রদান করবে। যেসকল বিজ্ঞাপন আপনার সামনে আসতে পারে</span></span><span style=\"font-family:SolaimanLipi\">,</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">আপনাকে বিশেষ প্রচার বা অফার সম্পর্কিত তথ্য প্রেরণ করতে। আমরা আপনাকে নতুন ফিচার বা পণ্য সম্পর্কেও জানাতে পারি। এর মধ্যে আমাদের ব্যবসায়িক অংশীদারদের (যেমন পেমেন্ট গেটওয়ে পার্টনার ইত্যাদি) বা তৃতীয় পক্ষ (যেমন বিপণন অংশীদার এবং অন্যান্য সার্ভিস সরবরাহকারী ইত্যাদি)</span></span><span style=\"font-family:SolaimanLipi\">, </span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">যাদের সাথে </span></span><span style=\"font-family:SolaimanLipi\">theExamly.com </span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">চুক্তি করেছে</span></span><span style=\"font-family:SolaimanLipi\">, </span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">তাদের অফার বা পণ্য অন্তর্ভুক্ত থাকতে পারে।</span></span><br />\r\n<span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">আমাদের ওয়েবসাইট দ্বারা প্রদত্ত সার্ভিসগুলো আরও উন্নত করে তোলার জন্য আমরা আপনার ব্যবসায়িক অংশীদার বা তৃতীয় পক্ষের সাথে আপনাদের কাছ থেকে প্রাপ্ত তথ্যকে একত্রিত করতে পারি।</span></span><br />\r\n<span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">আপনাকে বিজ্ঞপ্তি</span></span><span style=\"font-family:SolaimanLipi\">, </span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">যোগাযোগ</span></span><span style=\"font-family:SolaimanLipi\">, </span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">এই ওয়েবসাইটে প্রদত্ত সার্ভিসগুলো ব্যবহারের সাথে সম্পর্কিত সতর্কতাগুলি প্রেরণ করতে।</span></span><br />\r\n<span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">এই ওয়েবসাইট বা আমাদের সার্ভিসের কিছু বৈশিষ্ট্যের জন্য আপনাকে আমাদের ওয়েবসাইটটিতে আপনার অ্যাকাউন্ট বিভাগের অধীনে সরবরাহ করা ব্যক্তিগতভাবে সনাক্তযোগ্য তথ্য সরবরাহ করতে হতে পারে।</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">&nbsp;</span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">তথ্য শেয়ার এবং প্রকাশ</span></span></strong></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:SolaimanLipi\"><a href=\"https://theexamly.com/\" style=\"color:#0563c1; text-decoration:underline\"><strong>theExamly.com</strong></a>&nbsp;</span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">নিম্নলিখিত সীমাবদ্ধ পরিস্থিতিতে আপনার কাছ থেকে পূর্ববর্তী সম্মতি না পেয়ে কোনও তৃতীয় পক্ষ / সার্ভিস প্রদানকারী / ব্যবসায়িক অংশীদারকে ওয়েবসাইটে জমা দেওয়া আপনার তথ্য শেয়ার করতে পারে:</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">১. আইনের দ্বারা বা কোনও আদালত বা সরকারী সংস্থা বা কর্তৃপক্ষ কর্তৃক যখন এটি পরিচয় যাচাইকরণের উদ্দেশ্যে</span></span><span style=\"font-family:SolaimanLipi\">, </span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">বা প্রতিরোধ</span></span><span style=\"font-family:SolaimanLipi\">, </span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">সনাক্তকরণ</span></span><span style=\"font-family:SolaimanLipi\">, </span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">সাইবার ঘটনা তদন্ত</span></span><span style=\"font-family:SolaimanLipi\">, </span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">বা মামলা-মোকদ্দমা এবং অপরাধের শাস্তির জন্য প্রকাশ করার জন্য অনুরোধ করা হয় বা প্রয়োজন হয়।</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">২.</span></span><span style=\"font-family:SolaimanLipi\">&nbsp;<a href=\"https://theexamly.com/\" style=\"color:#0563c1; text-decoration:underline\"><strong>theExamly.com</strong></a>&nbsp;</span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">তার পক্ষ থেকে ব্যক্তিগত তথ্য প্রক্রিয়াকরণের উদ্দেশ্যে তার সহযোগী সংস্থাগুলি এবং এই জাতীয় সহযোগী সংস্থার কর্মকর্তা ও কর্মচারীদের মধ্যে এ জাতীয় তথ্য ভাগ করে নেওয়ার প্রস্তাব করে থাকে। আমরা এও নিশ্চিত করি যে এই জাতীয় তথ্যের প্রাপকরা আমাদের নির্দেশাবলীর উপর ভিত্তি করে এবং এই গোপনীয়তা নীতি এবং সুরক্ষা ব্যবস্থা গ্রহণের ভিত্তিতে এই জাতীয় তথ্যের প্রক্রিয়া করতে সম্মত হন।</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">৩.</span></span><span style=\"font-family:SolaimanLipi\">&nbsp;<a href=\"https://theexamly.com/\" style=\"color:#0563c1; text-decoration:underline\"><strong>theExamly.com</strong></a>&nbsp;</span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">ব্যবহারকারী যখন ওয়েবসাইট ভিজিট করেন তখন তৃতীয় পক্ষের বিজ্ঞাপন সংস্থাগুলি বিজ্ঞাপন পরিবেশন করতে পারে। এই সংস্থাগুলি ব্যবহারকারীর আগ্রহের পণ্য এবং পরিষেবাদি সম্পর্কিত বিজ্ঞাপন সরবরাহ করার জন্য ওয়েবসাইট এবং অন্যান্য ওয়েবসাইটগুলিতে ব্যবহারকারীর ভিজিট সম্পর্কে ব্যক্তিগত তথ্য ব্যবহার করতে পারে।</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">৪.</span></span><span style=\"font-family:SolaimanLipi\">&nbsp;<a href=\"https://theexamly.com/\" style=\"color:#0563c1; text-decoration:underline\"><strong>theExamly.com</strong></a>&nbsp;</span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">আপনার সম্পর্কে তথ্য স্থানান্তর করবে যদি আপনার কেনা কোর্সটি অথবা সার্ভিসটি অন্য কোনও সংস্থার দ্বারা অর্জিত বা একীভূত হয়। ওয়েবসাইটটিতে আপনার ভিজিট সম্পর্কিত তথ্য (আপনার নাম</span></span><span style=\"font-family:SolaimanLipi\">, </span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">ঠিকানা</span></span><span style=\"font-family:SolaimanLipi\">, </span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">ইমেল ঠিকানা বা মোবাইল নম্বর বাদে) ব্যবহার করতে পারে। আমরা তৃতীয় পক্ষের পরিষেবা সরবরাহকারীগুলিকে ইন্টারনেট এবং কখনও কখনও এই ওয়েবসাইটে আমাদের পক্ষ থেকে বিজ্ঞাপন পরিবেশন করতে ব্যবহার করি। তারা ওয়েবসাইটে আপনার পণ্য এবং পরিষেবাদির সাথে আপনার মিথস্ক্রিয়া সম্পর্কে বেনামে তথ্য সংগ্রহ করতে পারে। তারা আপনার এবং এই ওয়েবসাইটগুলিতে ভিজিট সম্পর্কিত তথ্য পণ্য এবং পরিষেবার জন্য লক্ষ্যযুক্ত বিজ্ঞাপনের জন্যও ব্যবহার করতে পারে। এই বেনামী তথ্য একটি পিক্সেল ট্যাগ ব্যবহার করে সংগ্রহ করা হয় যা বেশিরভাগ প্রধান ওয়েবসাইটগুলির দ্বারা ব্যবহৃত শিল্প মানের (</span></span><span style=\"font-family:SolaimanLipi\">industrial quality) </span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">প্রযুক্তি। এই প্রক্রিয়াটিতে কোনও ব্যক্তিগতভাবে সনাক্তযোগ্য তথ্য সংগ্রহ করা বা ব্যবহার করা হয় না।</span></span><span style=\"font-family:SolaimanLipi\">&nbsp;<a href=\"https://theexamly.com/\" style=\"color:#0563c1; text-decoration:underline\"><strong>theExamly.com</strong></a>&nbsp;</span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">এর সাথে সংযুক্ত বা অন্যান্য সাইটগুলি লিঙ্কযুক্ত থাকতে পারে। আপনি সেই সাইটগুলিতে যে ব্যক্তিগত তথ্য সরবরাহ করেন তা আমাদের সম্পত্তি নয়। এই অনুমোদিত সাইটগুলিতে তাদের নিজস্ব গোপনীয়তা রক্ষার নিয়মনীতি থাকতে পারে এবং আপনি যখন সে সাইটগুলো ভিজিট করবেন তখন আমরা আপনাকে সেই ওয়েবসাইটটির গোপনীয়তা নীতিগুলি পড়ে দেখার অনুরোধ করছি।</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">&nbsp;</span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">গোপনীয়তার নীতিমালা পরিবর্তন</span></span></strong></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">ওয়েবসাইট যেকোনো সময়ে এই নীতিটি তার নিজস্ব প্রয়োজনের উপর ভিত্তি করে পরিবর্তন করার অধিকার সংরক্ষণ করে। আমরা আপনাকে প্রতিটি পরিবর্তনের পর এই প্রাইভেসি পলিসিটি পুনরায় পড়ার অনুরোধ করছি।</span></span></span></span></p>', '2021-04-14 14:19:20', '2022-06-24 17:59:54', NULL, 1, 112, NULL);
