(1, '<p>১। শিক্ষকগণ তাদের জন্য নির্ধারিত বিষয়ে বাংলাদেশের শিক্ষাবোর্ডের নির্ধারিত সকল পরীক্ষার প্রশ্ন বিশ্লেষন করে নিয়মিতভাবে অধ্যায় ভিত্তিক নতুন নতুন প্রশ্ন তৈরী করবেন এবং আপলোড করবেন। একটি নির্দিষ্ট রুটিন অনুযায়ী অধ্যায় ভিত্তিক পরীক্ষা এবং মডেলটেস্ট এর জন্য প্রশ্নপত্র তৈরী করবেন ।</p>\r\n\r\n<p><br />\r\n২। বহুনির্বাচনি, শূন্যস্থান পূরণ, সত্য-মিথ্যা, মিল করণ ইত্যাদি পরীক্ষার উত্তরপত্র স্বয়ংক্রিয়ভাবে সিস্টেম মূল্যায়ন করবে। শুধু মাত্র লিখিত পরীক্ষা, হোম ওয়ার্ক, অ্যাসাইনমেন্ট এর উত্তরপত্র শিক্ষকগণকে মূল্যায়ন করতে হবে এবং নম্বর প্রদান করতে হবে ।</p>\r\n\r\n<p><br />\r\n৩। শিক্ষকগণ তাদের জন্য নির্ধারিত বিষয়ে যেসকল শীক্ষার্থী অংশগ্রহণ করবেন তাদের যদি কোন প্রশ্ন থাকে তবে তার উত্তর দিবেন ।</p>\r\n\r\n<p><br />\r\n৪। শিক্ষকদের অবশ্যই সবসময় অনলাইনে থাকবেন ।</p>\r\n\r\n<p><br />\r\n৫। নিয়মিত নতুন নতুন ছাত্রছাত্রীকে theExamly.com এ সংযুক্ত করার বিষয়ে সচেষ্ট থাকতে হবে এবং এই বিষয়ে মার্কেটিং টিমকে সহযোগীতা করতে হবে ।&nbsp;</p>\r\n\r\n<p><br />\r\n৬। একটি বিষয়ে সাধারণত একজন শিক্ষক থাকবেন তবে যদি একাধিক শিক্ষক দরকার&nbsp;হয়&nbsp;তবে&nbsp;তার সিদ্ধান্ত নেবার ক্ষমতা একমাত্র &ldquo;দি এক্সামলি&rdquo; কর্তৃপক্ষের ।</p>\r\n\r\n<p><br />\r\n৭। &nbsp;কোন শিক্ষক তার&nbsp;দায়িত্ব থেকে অব্যাহতি চাইলে কমপক্ষে ২ মাস পূর্বে জানাতে হবে ।</p>\r\n\r\n<p><br />\r\n৮। উপরোক্ত যেকোন একটি শর্ত না মানলে বা দায়িত্বে কোন প্রকার অবহেলা দেখা দিলে &ldquo;দি এক্সামলি&rdquo; কর্তৃপক্ষ সাথে সাথে যে কাউকে অব্যাহতি দিতে পারে ।</p>\r\n\r\n<p><br />\r\n৯। প্রাথমিকভাবে প্রত্যেক শিক্ষক তার নির্ধারিত বিষয়/বিষয়সমূহ হতে মোটে উপার্জনের ২৫% সম্মানী হিসাবে পাবেন। উপার্জনের পরিমাণ শিক্ষক তার নিজস্ব ড্যাসবোর্ডে দেখতে পারবেন ।</p>', 1, '2021-05-01 15:39:16', '2021-05-04 09:58:26', NULL, 1, 1, 1);
