INSERT INTO `terms_conditions` (`id`, `description`, `created_at`, `updated_at`, `deleted_at`, `created_by`, `updated_by`, `deleted_by`) VALUES
(2, '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\"><a href=\"https://theexamly.com/\" style=\"color:#0563c1; text-decoration:underline\">theExamly.com</a>&nbsp;</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">ওয়েবসাইটে আপনাকে স্বাগতম।</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">&nbsp;<a href=\"https://theexamly.com/\" style=\"color:#0563c1; text-decoration:underline\">theExamly.com</a>&nbsp;</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">নিম্নলিখিত শর্ত সাপেক্ষে আপনাকে সার্ভিস প্রদান করে। সাইটটি ব্যবহারের আগে আপনাকে অবশ্যই এই শর্তাদি এবং লিঙ্কযুক্ত</span></span>&nbsp;<span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">গোপনীয়তা নীতিমালাতে</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">&nbsp;(</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">প্রাইভেসি পলিসি) থাকা সমস্ত শর্তাদি পড়তে এবং মেনে চলতে হবে। আমরা দৃঢ়ভাবে অনুরোধ করছি যে আপনি এই ব্যবহারের শর্তাদি পড়ার সাথে সাথে সংযুক্ত গোপনীয়তা নীতিমালাটি</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">&nbsp;(</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">প্রাইভেসি পলিসি) পড়বেন। আপনি যদি এই ব্যবহারের শর্তাদি এবং গোপনীয়তা নীতিমালা</span></span>&nbsp;<span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">দ্বারা আবদ্ধ হতে সম্মত না হন তবে আপনি কোনওভাবেই সাইটটি ব্যবহার করতে পারবেন না। ব্যবহারের শর্তাবলীর লেটেস্ট সংস্করণ পড়তে অবশ্যই এই পেইজটিতে আসবেন। আমরা কোন নোটিশ ছাড়াই সাইটটি ব্যবহারের শর্তাদি পরিবর্তন বা সংশোধন করার অধিকার সংরক্ষণ করি এবং আপনার এই সাইটে অবিচ্ছিন্ন অ্যাকসেস বা ব্যবহার আপনার আপডেট হওয়া বা পরিবর্তিত ব্যবহারের শর্তাদির স্বীকৃতি প্রকাশ করে।</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">&nbsp;</span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">১. ব্যবহারকারীর যোগ্যতা</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">ব্যবহারকারীকে অবশ্যই <a href=\"https://theexamly.com/\" style=\"color:#0563c1; text-decoration:underline\">theExamly.com</a> কর্তৃক প্রদত্ত নিয়মাবলি যথাযথভাবে মেনে চলতে হবে। অন্যথায় ব্যবহারকারীকে তার অনিয়ম অনুযায়ী সাময়িক বা আজীবন অবিবেচ্য বলে গণ্য করা হতে পারে।</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">২. আপনার অ্যাকাউন্ট</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">আপনি যদি সাইটটি ব্যবহার করেন তবে আপনি নিজের অ্যাকাউন্ট এবং পাসওয়ার্ডের গোপনীয়তা বজায় রাখতে এবং আপনার কম্পিউটারে অ্যাকসেস সীমাবদ্ধ করার জন্য </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">আপনি </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">দায়বদ্ধ। আপনার অ্যাকাউন্ট বা পাসওয়ার্ডের অধীনে ঘটে যাওয়া সমস্ত ক্রিয়াকলাপের জন্য আপনি দায় স্বীকার করতে সম্মতি জানাচ্ছেন। এ</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">ই</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\"> কারণে</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">, </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">আমরা দৃঢ়ভাবে অনুরোধ করব যে আপনি প্রতিটি সেশন শেষে আপনার অ্যাকাউন্ট থেকে লগআউট করুন। আপনি আপনার অ্যাকাউন্টের কোনও অননুমোদিত ব্যবহার বা সুরক্ষা লঙ্ঘনের বিষয়ে অবিলম্বে</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">&nbsp;<a href=\"https://theexamly.com/\" style=\"color:#0563c1; text-decoration:underline\">theExamly.com</a>&nbsp;</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">কে অবহিত করতে সম্মতি জানাচ্ছেন। </span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">যিনি কিনবেন শুধুমাত্র তিনিই ব্যবহার করবেন । যদি অন্য কেউ ব্যবহার করেন তাহলে তার জন্য এক্সামলি কর্তৃপক্ষ যথাযথ ব্যবস্থা নিতে পারবে। তাই আপনার অ্যাকাউন্টের তথ্য অন্য কারও সাথে শেয়ার করবেন না।</span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">&nbsp;</span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">৩. ওয়েবসাইটের উপলব্ধতাঃ</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">সরকারি নির্দেশনা মোতাবেক সকল প্রকার পাবলিক পরীক্ষা</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">, </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">ভর্তি পরীক্ষা</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">, </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">নিয়োগ পরীক্ষার সময়</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">,&nbsp;</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">সাইট রক্ষণাবেক্ষণের সময় ও অন্য কোন কারণে</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">&nbsp;<a href=\"https://theexamly.com/\" style=\"color:#0563c1; text-decoration:underline\">theExamly.com</a>&nbsp;</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">সাইটটি সাময়িক</span></span>&nbsp;<span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">বন্ধ থাকতে পারে।</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">&nbsp;<a href=\"https://theexamly.com/\" style=\"color:#0563c1; text-decoration:underline\">theExamly.com</a>&nbsp;</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">এর উপলব্ধতার বিষয়ে কর্তৃপক্ষের সিদ্ধান্ত চূড়ান্ত বলে গণ্য হবে।</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">&nbsp;</span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">৪. রিটার্ন পলিসি</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">এই সার্ভিস/ পণ্যটি ক্রয়ে আপনার সম্পূর্ণ সম্মতি নিয়েই ওয়েবসাইটের মাধ্যমে আপনার পেমেন্টটি সংগ্রহ করা হবে। কোনও অর্থ ফেরৎ বা লেনদেন বাতিলকরণ অনুমোদিত নয়।</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">&nbsp;</span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">৫. দায়বদ্ধতা </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">এবং নির্ভরতা </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">অস্বীকৃতি</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">এই সাইটে প্রকাশিত কন্টেন্ট বা প্রশ্ন পত্র</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">, </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">পণ্য</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">, </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">সার্ভিসগুলি বা উভয়ই ক্ষেত্রে ভুল বা অসম্পূর্ণতা পাওয়া যেতে পারে । এই সাইটের কন্টেন্ট বা প্রশ্নপত্র</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">, </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">পণ্য</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">, </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">সার্ভিসের তথ্য এবং বিবরণ সম্পর্কিত যে কোনও ত্রুটি বা অন্য ভুলের জন্য আমরা গ্যারান্টি প্রদান করি না এবং এর জন্য </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">আমরা</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\"> দায়বদ্ধ নই । আপনার কাছে এসবের কোন ভুল পরিলক্ষিত হলে দ্রুত</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">&nbsp;<a href=\"tel:+%E0%A7%AE%E0%A7%AE%E0%A7%A6%E0%A7%A7%E0%A7%AD%E0%A7%A7%E0%A7%AB%E0%A7%AC%E0%A7%A6%E0%A7%A9%E0%A7%A6%E0%A7%AA%E0%A7%A8\" style=\"color:#0563c1; text-decoration:underline\">০১৭১৫৬০৩০৪২</a>&nbsp;</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">অথবা</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">&nbsp;<a href=\"mailto:content@theexamly.com\" style=\"color:#0563c1; text-decoration:underline\">content@theexamly.com</a>&nbsp;</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">এ অবগত করুন। এক্সামলি কর্তৃপক্ষ এই বিষয়ে যথাযথ ব্যবস্থা গ্রহণ করবে। এই বিষয়ে আপনি কোন রূপ আইনি ব্যবস্থা নিতে পারবেন না । &nbsp;</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">&nbsp;</span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">৬. অনলাইন উপলভ্যতা</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">, </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">ইমপ্রেশন এবং ক্লিক-থ্রুর দাবি অস্বীকার</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">এই নোটিশে আলোচিত অন্যান্য দাবি এবং সীমাবদ্ধতা ছাড়াও</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">&nbsp;<a href=\"https://theexamly.com/\" style=\"color:#0563c1; text-decoration:underline\">theExamly.com</a>&nbsp;</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">এর ওয়েব পেইজগুলোতে উপস্থাপিত কোনও উপাদান</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">, </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">তথ্য</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">, </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">লিঙ্ক</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">, </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">বা সামগ্রীর কোনও গ্যারান্টি </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">এবং </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">ওয়্যারেন্টি নেই।</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">&nbsp;<a href=\"https://theexamly.com/\" style=\"color:#0563c1; text-decoration:underline\">theExamly.com</a>&nbsp;</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">এ ওয়েব পেইজগুলিতে উপস্থাপিত যে কোনও উপাদান</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">, </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">তথ্য</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">, </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">লিঙ্ক</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">, </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">বা সামগ্রী যে কোনও সময় অনলাইন অ্যাকসেসের জন্য বন্ধ হয়ে যেতে পারে। সাইটটিতে কোনও বিজ্ঞাপনের সামগ্রী</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">, </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">তথ্য</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">, </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">লিঙ্ক</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">, </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">ব্যানার</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">, </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">এবং গ্রাফিক্স পোস্ট করার আগে</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">&nbsp;<a href=\"https://theexamly.com/\" style=\"color:#0563c1; text-decoration:underline\">theExamly.com</a>&nbsp;</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">এর দ্বারা অনুমোদিত হতে হবে।</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">&nbsp;<a href=\"https://theexamly.com/\" style=\"color:#0563c1; text-decoration:underline\">theExamly.com</a>&nbsp;</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">যে কোনও কারণে বিজ্ঞাপনের স্পনসর বা কোনও বিজ্ঞাপন গ্রহণ বা প্রত্যাখ্যান করার অধিকার সংরক্ষণ করে।</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">&nbsp;</span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">৭. অনলাইন কমিউনিকেশান</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">আপনি যখন সাইটটি ব্যবহার করেন বা</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">&nbsp;<a href=\"https://theexamly.com/\" style=\"color:#0563c1; text-decoration:underline\">theExamly.com</a>&nbsp;</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">এ ইমেইলগুলি প্রেরণ করেন</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">, </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">আপনি</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">&nbsp;<a href=\"https://theexamly.com/\" style=\"color:#0563c1; text-decoration:underline\">theExamly.com</a>&nbsp;</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">এর সাথে অনলাইন যোগাযোগ করছেন। আপনি</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">&nbsp;<a href=\"https://theexamly.com/\" style=\"color:#0563c1; text-decoration:underline\">theExamly.com</a>&nbsp;</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">এর কাছ থেকে অনলাইন মাধ্যমে যোগাযোগগুলি গ্রহণ করতে সম্মতি জানাচ্ছেন।</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">&nbsp;<a href=\"https://theexamly.com/\" style=\"color:#0563c1; text-decoration:underline\">theExamly.com</a>&nbsp;</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">আপনার সাথে ইমেইলের মাধ্যমে বা সাইটে নোটিশ পোস্ট করে বা ফোনে বা সাধারণত উপলব্ধ যোগাযোগের মাধ্যমে যোগাযোগ করতে পারে। আপনি সম্মতি জানাচ্ছেন যে আমরা আপনাকে প্রদত্ত সমস্ত চুক্তি</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">, </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">বিজ্ঞপ্তি</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">, </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">প্রকাশ এবং অন্যান্য যোগাযোগগুলি বৈদ্যুতিনভাবে কোনও আইনগত প্রয়োজনীয়তা পূরণ করে যে এই জাতীয় যোগাযোগ লিখিতভাবে রয়েছে।</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">&nbsp;</span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">৮. পাসওয়ার্ড সংরক্ষণ</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">সাইটের পাসওয়ার্ড এর রক্ষনাবেক্ষন অথবা পেইজে অ্যাকসেস এবং ব্যবহার কেবল অনুমোদিত ব্যবহারকারীদের জন্যই সীমাবদ্ধ। সাইটের এই পেইজগুলি অনুমোদন ছাড়া অ্যাকসেস করার চেষ্টা করা হলে অননুমোদিত ব্যক্তিদের বিরুদ্ধে মামলা-মোকদ্দমা হতে পারে।</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">অবশ্যই আপনি একটি আলাদা পাসওয়ার্ড ব্যবহার করবেন </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">| </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">যাতে অন্য কোন ওয়েব সাইটে</span></span>&nbsp;<span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">আপনার দেওয়া পাসওয়ার্ডের সাথে মিল</span></span>&nbsp;<span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">না থাকে </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">| </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">যদি আপনার এমন ভুলের কারণে আপনার ক্ষতি সাধিত হয় সেক্ষেত্রে এক্সামলি</span></span>&nbsp;<span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">কর্তৃপক্ষ</span></span>&nbsp;<span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">কোন ভাবে দায়ী</span></span>&nbsp;<span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">থাকবে না </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">|</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">&nbsp;</span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">৯. সংশোধন এবং পরিবর্তন সমূহের বিজ্ঞপ্তি</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\"><a href=\"https://theexamly.com/\" style=\"color:#0563c1; text-decoration:underline\">theExamly.com</a>&nbsp;</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">যে কোনো</span></span>&nbsp;<span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">সময়ে</span></span>&nbsp;<span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">ব্যবহারের শর্তাবলী</span></span>&nbsp;<span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">এবং সাইটে পরিবর্তনের</span></span>&nbsp;<span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">সকল অধিকার সংরক্ষণ করে।</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">&nbsp;<a href=\"https://theexamly.com/\" style=\"color:#0563c1; text-decoration:underline\">theExamly.com</a>&nbsp;</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">যদি এই ব্যবাহারের</span></span>&nbsp;<span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">শর্তাবলী বা</span></span>&nbsp;<span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">নীতিমালায় কোনও পরিবর্তন করে তবে তা আপনাকে জানিয়ে দিতে পারে: (</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">i) </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">এই ব্যবহার শর্তাবলী বা গোপনীয়তা নীতিমালার (প্রাইভেসি পলিসি) পরিবর্তনগুলির উপরে ত্রিশ (৩০) দিনের একটি বিশেষ ঘোষণা প্রদর্শন করা যথেষ্ট বলে গণ্য করা হবে। গোপনীয়তা নীতিমালার (প্রাইভেসি পলিসি) টপিকে পরিবর্তনের নোটিশ ৩০ দিনের জন্য পোস্ট করার পরে</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">, </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">নোটিশটি সরানো হবে। যদি আপনি ৩০ দিনেরও বেশি সময় ধরে সাইটটি ব্যবহার না করেন তবে সাইটের আরও ব্যবহারের আগে আপনার ব্যবহারের শর্তাবলী এবং</span></span>&nbsp;<span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">গোপনীয়তা নীতিমালা (প্রাইভেসি পলিসি) পড়ে নেয়া উচিত। আপনি যদি ব্যবহারের শর্তাবলী বা প্রাইভেসি পলিসিতে কোনও পরিবর্তন করার কারণে আপনার অ্যাকাউন্টটি বন্ধ করতে চান</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">, </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">তবে আপনি</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">&nbsp;<a href=\"mailto:info@theExamly.com\" style=\"color:#0563c1; text-decoration:underline\">info@theExamly.com</a>&nbsp;</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">এই</span></span>&nbsp;<span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">ইমেইল ঠিকানায় &quot;সমাপ্তি&quot; বিষয়ে উল্লেখ করে একটি ইমেল পাঠিয়ে তা করতে পারেন। আপনি যদি সাইটটি ব্যবহার চালিয়ে যান</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">, </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">তাহলে ধরে নেয়া হবে যে নতুন ব্যবহার শর্তাবলী</span></span>&nbsp;<span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">এবং</span></span>&nbsp;<span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">গোপনীয়তা নীতিমালার (প্রাইভেসি পলিসি) বিরুদ্ধে আপনার কোন অভিযোগ নেই।</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">&nbsp;</span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">১০. ট্রেডমার্ক</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">সাইটে প্রদর্শিত ট্রেডমার্ক</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">, </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">লোগো এবং পরিষেবা চিহ্ন সহ সকল কন্টেন্ট</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">&nbsp;<a href=\"https://theexamly.com/\" style=\"color:#0563c1; text-decoration:underline\">theExamly.com</a>&nbsp;</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">এর সম্পত্তি।</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">&nbsp;<a href=\"https://theexamly.com/\" style=\"color:#0563c1; text-decoration:underline\">theExamly.com</a>&nbsp;</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">এর যথাযথ কর্তৃপক্ষের লিখিত অনুমতি ব্যতীত যে কোনও কন্টেন্ট অন্য যেকোন ওয়েবসাইটে ব্যবহার অথবা অন্য যে কোনও উদ্দেশ্যে কোনও কন্টেন্ট ব্যবহার করা নিষিদ্ধ।</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">&nbsp;<a href=\"https://theexamly.com/\" style=\"color:#0563c1; text-decoration:underline\">theExamly.com</a>&nbsp;</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">তে প্রাপ্ত সমস্ত তথ্য এবং কন্টেন্ট কপিরাইট দ্বারা সুরক্ষিত। ব্যবহারকারীদের বাণিজ্যিক বা জনসাধারণের উদ্দেশ্যে সাইটের উপর বা মাধ্যমে প্রাপ্ত যে কোনও বিষয়বস্তু সংশোধন</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">, </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">কপি</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">, </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">বিতরণ</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">, </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">প্রেরণ</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">, </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">প্রদর্শন</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">, </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">প্রকাশ</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">, </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">বিক্রয়</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">, </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">লাইসেন্সিং</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">, </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">ডেরাইভেটিভ কাজ তৈরি করা বা ব্যবহার নিষিদ্ধ।</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">&nbsp;</span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">&nbsp;</span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">উপরোক্ত বিষয়গু</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">লো </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">&nbsp;অমান্য বা ভঙ্গ করলে</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">&nbsp;<a href=\"https://theexamly.com/\" style=\"color:#0563c1; text-decoration:underline\">theExamly.com</a>,&nbsp;<a href=\"https://ictd.gov.bd/site/view/law/%E0%A6%86%E0%A6%87%E0%A6%A8-%E0%A6%93-%E0%A6%AC%E0%A6%BF%E0%A6%A7%E0%A6%BF-\" target=\"_blank\">THE ICT ACT of Bangladesh</a> </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">এর অধিনে যেকোন সময় </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">উপযুক্ত </span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">ব্যবস্থা নিতে পারবে</span></span><span style=\"font-size:14.0pt\"><span style=\"font-family:SolaimanLipi\">।</span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>', '2021-04-14 14:28:11', '2022-06-24 17:56:19', NULL, 1, 112, NULL);
