(2, 'কিভাবে লগইন করবেন', '<p>আপনি যদি রেজিস্ট্রার্ড মেম্বার হন তবে সরাসরি লগইন করুন। লগইন করার জন্য-</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>theExamly.com</strong> সাইটে প্রবেশের পর আপনার স্ক্রিনের উপরের ডান কোনায় লগইন বাটনে ক্লিক করুন। আপনার সামনে একটি লগইন ফরম আসবে। এখানে আপনার ইমেইলে প্রদত্ত ইউজার আইডি (জিমেইল) এবং পাসওয়ার্ডটি সঠিকভাবে প্রদান করুন&nbsp;এবং লগ-ইন বাটনে ক্লিক করুন এবং&nbsp;পরীক্ষা দেবার জন্য প্রবেশ করুন।</p>', '1618992705.png', 'public/uploads/files/userManual/video\\1617266985-videoplayback.mp4', 1, '2021-04-01 05:25:39', '2022-05-09 07:21:18', NULL, 1, 1, NULL),
(3, 'কিভাবে অনলাইন পরীক্ষায় অংশগ্রহণ করবেন', '<p><strong>১।</strong> <strong>theExamly.com</strong> এ পরীক্ষায় অংশ গ্রহণ করতে হলে আপনাকে অবশ্যই রেজিস্ট্রেশন&nbsp;করতে হবে। রেজিস্ট্রেশন&nbsp;করার জন্য <a href=\"https://theexamly.com/admission/form\">এখানে ক্লিক করুন</a>। আর আপনি যদি রেজিস্ট্রার্ড মেম্বার হন তবে সরাসরি লগইন করুন।</p>\r\n\r\n<p><strong>২। </strong>লগইন করার পরে উপরে ডানপাশে আপনার <strong>প্রোফাইলে</strong> ক্লিক করলে পাবেন <strong>&quot;পরীক্ষা কেন্দ্র&quot;</strong> বাটন যার মাধ্যমে আপনি আপনি যে পরীক্ষা গুলি ক্রয় করতে চান তার নামসহ(চাকুরী নিয়োগ, বিশ্ববিদ্যালয় ভর্তি, পলিটেকনিক ইনস্টিটিউট, স্কুল এন্ড কলেজ) পরীক্ষার ধরণ দেওয়া আছে। নামের ওপর ক্লিক করলে একটি নতুন পেইজ আসবে এখানে আপনার পরীক্ষার নাম ও ব্যাচ সিলেক্ট করলে নিচে পেমেন্টের পরিমাণ দেখাবে, নিচে <strong>&quot;ক্রয় করুন&quot;</strong> বাটনে ক্লিক করে বিকাশ, রকেট, নগদ অথবা কার্ডের মাধ্যমে পেমেন্ট করে আপনার কাঙ্ক্ষিত পরীক্ষাটি ক্রয় করে পরীক্ষায় অংশ গ্রহন করতে পারবেন (শুধু মাত্র এস এস সি ও এইচ এস সি পরীক্ষার ক্ষেত্রে শূণ্য টাকা দেখাবে) । এখন আপনি &quot;অগ্রসর হন&quot; বাটনের উপর ক্লিক করলেই আপনাকে পরীক্ষার দেওয়ার জন্য নির্দিষ্ট পরীক্ষার কেন্দ্রে&nbsp; নিয়ে যাবে।<br />\r\n&nbsp;<br />\r\n৩। এখানে আপনার সামনে একটি ড্যাসবোর্ড আসবে যেখানে বামপাশে থাকবে একটি মেনু যেখানে&nbsp; <strong>&quot;My Courses&quot;</strong> এর অধীনে আপনার ক্রয়কৃত প্রস্তুতি পরীক্ষা গুলি দেখাবে সেখান থেকে যে বিষয়ে পরীক্ষা দিতে চান তার উপর ক্লিক করে বিষয়টিতে প্রবেশ করুন।<br />\r\n&nbsp;<br />\r\nঅথবা, আপনার ড্যাসবোর্ডের একটু নীচের দিকে <strong>&quot;Course overview&quot;</strong> নামক ব্লক এর অধীনে আপনার ক্রয়কৃত বিষয়গুলি দেখাবে সেখান থেকে যে বিষয়ে পরীক্ষা দিতে চান তার উপর ক্লিক করে বিষয়টিতে প্রবেশ করুন।<br />\r\n&nbsp;<br />\r\n৪। আপনি বিষয়টিতে প্রবেশ করলেই প্রথমেই অধ্যায় ভিত্তিক পরীক্ষা পাবেন এবং সবশেষে থাকবে জাতীয় শিক্ষানীতি এবং সিলেবাস&nbsp; অনুযায়ী মডেল টেস্ট।<br />\r\n&nbsp;<br />\r\n৫। যেই পরীক্ষাটিতে অংশ গ্রহণ করতে চান তার উপর ক্লিক করুন। <strong>এমসিকিউ পরীক্ষা</strong> ও <strong>লিখিত পরীক্ষা</strong> দেওয়ার নিয়মাবলী জানতে পরবর্তী ব্যবহারবিধি দুইটা পড়ুন ।</p>', '1618998103-online-exam.png', '', 1, '2021-04-21 09:41:43', '2022-06-23 05:21:33', NULL, 1, 112, NULL),
(1, 'একাউন্ট কিভাবে খুলবেন', '<p><strong>theExamly.com</strong> প্রবেশ করে&nbsp;আপনার স্ক্রিনের উপরের দিকের ডান কোনায় অবস্থিত রেজিস্ট্রেশন বাটনে ক্লিক করুন। আপনার সামনে একটি রেজিস্ট্রেশন ফরম আসবে। এখানে সকল তথ্য ইংরেজিতে পূরণ করতে হবে। যেসকল তথ্য আপনাকে দিতে হবে তা হলো;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>১।</strong> <strong>&ldquo;নামের প্রথম অংশ (নামের শেষ অংশ বাদে সকল অংশ )&rdquo;</strong> ফিল্ডে নামের প্রথম অংশ (মনে করুন আপনার নাম &quot;Md. Abdullah Al Mamun&quot;, এখানে আপনার নামের প্রথম অংশ হলো &quot;Md. Abdullah Al&quot; অর্থাৎ শেষের অংশটি বাদ দিয়ে সম্পূর্ণটায় আপনার নামের প্রথম অংশ)। <strong>&ldquo;নামের শেষ অংশ&rdquo;</strong> ফিল্ডে আপনার নামের শেষ অংশ যেমন &quot;Mamun&quot; লিখুন।</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>২। &ldquo;ইমেইল&rdquo;</strong> ফিল্ডে আপনার একটি সক্রিয় জি-মেইল এড্রেস দিন। জি-মেইল এড্রেসটি সতর্কতার সাথে প্রদান&nbsp;করুন, কারণ এই &nbsp;জি-মেইল এড্রেসে একটি ভেরিফিকেশান মেইল প্রদান করা হবে।</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>৩।</strong> <strong>&ldquo;মোবাইল নাম্বার&rdquo;</strong> ফিল্ডে আপনার ব্যাক্তিগত মোবাইল নাম্বার টি প্রদান করুন।</p>\r\n\r\n<p><br />\r\n<strong>৪।</strong> <strong>&ldquo;পাসওয়ার্ড&rdquo;</strong> ফিল্ড এ&nbsp;আপনার পাসওয়ার্ড টি লিখুন, পাসওয়ার্ডটিতে অবশ্যই বড় হাতের অক্ষর, ছোট হাতের অক্ষর, সংখ্যা এবং একটি স্পেশাল ক্যারেক্টার (!,@,#,$,%,^,&amp;,*) সহ কমপক্ষে ৮ টি অক্ষর থাকতে হবে।</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>৫।</strong> <strong>&ldquo;কনফার্ম পাসওয়ার্ড&rdquo;</strong> আপনার পাসওয়ার্ড টি পুনরায় লিখুন।</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>৬।</strong> <strong>&ldquo;এক্সামলী সম্পর্কে সর্ব প্রথম কিভাবে জেনেছিলেন ?&rdquo;&nbsp;</strong>ফিল্ড এ&nbsp;আপনি এক্সামলী সম্পর্কে সর্ব প্রথম কোথা থেকে জেনেছেন সেই বিষয়ের পাশে টিক চিহ্ন দিন।&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>৭।&nbsp;&ldquo;&nbsp;পূর্বের এক্সামলী ব্যবহারকারির রেফার কোড&nbsp;&rdquo;&nbsp;</strong>ফিল্ড এ&nbsp;আপনার কাছে পূর্বের এক্সামলী ব্যবহারকারির রেফার কোড থাকলে তা দিতে পারেন।&nbsp;পূর্বের এক্সামলী ব্যবহারকারির রেফার কোডটি আপনি ব্যবহার করলে উক্ত রেফার কোডধারী ব্যক্তি এক্সামলীর পক্ষ থেকে পুরস্কৃত হবেন এবং আপনিও আপনার রেফার কোডটি শেয়ার করলে এবং আপনার রেফার কোডটি অন্য কেউ ব্যবহার করলে আপনিও পুরস্কৃত হবেন।</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>৮।</strong> এরপর <strong>&ldquo;আমি গোপনীয়তার নীতিমালা, ব্যবহারের শর্তাবলীর সাথে একমত পোষণ করছি ।&rdquo;</strong> বিষয়ের সাথে একমত প্রকাশ করার জন্য চেক বক্সটিতে ক্লিক করুন।</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>৯।</strong> উপরের সকল তথ্য সঠিক ভাবে প্রদান করা হলে <strong>&ldquo;সাইন আপ&rdquo;</strong> বাটনে ক্লিক করুন।</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>১০।</strong> এবার আপনার অ্যাকাউন্ট ভেরিফিকেশনের জন্য আপনার প্রদত্ত ইমেইল এ একটি ভেরিফিকেশান মেইল প্রদান করা হবে। ভেরিফিকেশান মেইল দেখার জন্য আপনার ইনবক্স অথবা স্পাম চেক করুন। মেইল খুললে আপনি অপনার আইডি এবং পাসওয়ার্ডটি পেয়ে যাবেন। এবার আপনার অ্যাকাউন্ট ভেরিফিকেশনের জন্য <strong>&quot;Confirm Email Address&quot;</strong> বাটনে ক্লিক করুন। আপনাকে একটি লগইন পেজ দেখাবে, এখানে আপনার মেইলে প্রদত্ত আইডি (জিমেইল) এবং পাসওয়ার্ড দিয়ে লগইন করুন।&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>আপনার একাউন্ট তৈরী সম্পন্ন হয়েছে।<br />\r\n&nbsp;</p>', '1618992924.png', 'public/uploads/files/userManual/video\\1617266446-videoplayback.mp4', 1, '2021-04-01 06:03:45', '2022-05-09 04:41:57', NULL, 1, 1, NULL),
(4, 'আরও নতুন প্রস্তুতি পরীক্ষাসমূহ কিভাবে ক্রয় করবেন', '<p>১। theExamly.com এ পরীক্ষায় অংশ গ্রহণ করতে হলে আপনাকে অবশ্যই রেজিস্ট্রেশন করতে হবে। রেজিস্ট্রেশন করার জন্য <a href=\"https://theexamly.com/admission/form\" target=\"_blank\">এখানে ক্লিক</a> করুন। আর আপনি যদি রেজিস্ট্রার্ড মেম্বার হন তবে সরাসরি লগইন করুন।<br />\r\n&nbsp;<br />\r\n২। এখানে প্রথমেই থাকবে &quot;শুরু করুন&quot; বাটন যার মাধ্যমে আপনি পরীক্ষা কেন্দ্রে যেতে পারবেন এবং তার নিচেই আপনি যে পরীক্ষা গুলি ক্রয় করতে চান তার নামসহ(চাকুরী নিয়োগ, বিশ্ববিদ্যালয় ভর্তি, পলিটেকনিক ইনস্টিটিউট, স্কুল এন্ড কলেজ) পরীক্ষার ধরণ দেওয়া আছে। নামের ওপর ক্লিক করলে একটি নতুন পেইজ আসবে এখানে আপনার পরীক্ষার নাম ও ব্যাচ সিলেক্ট করলে নিচে পেমেন্টের পরিমাণ দেখাবে, নিচে &quot;ক্রয় করুন&quot; বাটনে ক্লিক করে বিকাশ, রকেট, নগদ অথবা কার্ডের মাধ্যমে পেমেন্ট করে আপনার কাঙ্ক্ষিত পরীক্ষাটি ক্রয় করে পরীক্ষায় অংশ গ্রহন করতে পারবেন (শুধু মাত্র এস এস সি ও এইচ এস সি পরীক্ষার ক্ষেত্রে শূণ্য টাকা দেখাবে) । এখন আপনি &quot;অগ্রসর হন&quot; বাটনের উপর ক্লিক করলেই আপনাকে পরীক্ষার দেওয়ার জন্য নির্দিষ্ট পরীক্ষার কেন্দ্রে&nbsp; নিয়ে যাবে।<br />\r\n&nbsp;<br />\r\n৩। এখানে আপনার সামনে একটি ড্যাসবোর্ড আসবে যেখানে বামপাশে থাকবে একটি মেনু যেখানে&nbsp; &quot;My Courses&quot; এর অধীনে আপনার ক্রয়কৃত প্রস্তুতি পরীক্ষা গুলি দেখাবে সেখান থেকে যে বিষয়ে পরীক্ষা দিতে চান তার উপর ক্লিক করে বিষয়টিতে প্রবেশ করুন।<br />\r\n&nbsp;<br />\r\nঅথবা, আপনার ড্যাসবোর্ডের একটু নীচের দিকে &quot;Course overview&quot; নামক ব্লক এর অধীনে আপনার ক্রয়কৃত বিষয়গুলি দেখাবে সেখান থেকে যে বিষয়ে পরীক্ষা দিতে চান তার উপর ক্লিক করে বিষয়টিতে প্রবেশ করুন।<br />\r\n&nbsp;<br />\r\n৪। আপনি বিষয়টিতে প্রবেশ করলেই প্রথমেই অধ্যায় ভিত্তিক পরীক্ষা পাবেন এবং সবশেষে থাকবে জাতীয় শিক্ষানীতি এবং সিলেবাস&nbsp; অনুযায়ী মডেল টেস্ট।<br />\r\n&nbsp;<br />\r\n৫। যেই পরীক্ষাটিতে অংশ গ্রহণ করতে চান তার উপর ক্লিক করুন। এমসিকিউ পরীক্ষা ও লিখিত পরীক্ষা দেওয়ার নিয়মাবলী জানতে পরবর্তী ব্যবহারবিধি দুইটা পড়ুন ।</p>', '1618999061-exam-purchase.png', '', 0, '2021-04-21 09:57:41', '2022-06-23 05:22:18', NULL, 1, 112, NULL),
(23, 'এমসিকিউ পরীক্ষা দেওয়ার নিয়মাবলী', '<p>এসব পরীক্ষায়&nbsp;অংশগ্রহণ করেছেন আপনার মেধা যাচাই করার জন্য। দয়া করে নকল করে বা কারও সাহায্য নিয়ে পরীক্ষাটি দিবেন না, কারণ এতে আপনি নিজেই ক্ষতিগ্রস্থ হবেন&nbsp;এবং&nbsp;আপনার মেধা সঠিক ভাবে যাচাই করা হবে না। তাই আপনি নিজেই পরীক্ষাটি দেওয়ার চেষ্টা করবেন। যদি খারাপ হয় তবে পুনরায় পরীক্ষা দেবার সুযোগ থাকছে।</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>এমসিকিউ পরীক্ষা দেওয়ার নিয়মাবলীঃ</strong></h3>\r\n\r\n<p><strong>১।</strong>&nbsp;পরীক্ষা কেন্দ্রে পরীক্ষার নামের উপর ক্লিক করুন যেমন: <strong>&quot;এমসিকিউ - ১&quot;</strong>। এরপর যে পেজটি আসবে সেখানে পরীক্ষাটি কতদিন চালু থাকবে এবং আপনি শুরু করার পর কতক্ষণের মধ্যে তা শেষ করতে হবে তা বিস্তারিত বর্ণণা দেওয়া থাকবে।</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>২।</strong>&nbsp;এবার <strong>&ldquo;Attempt quiz now&quot;</strong> নামক বাটনে ক্লিক করুন, এবং পরীক্ষায় অংশগ্রহণ সংক্রান্ত একটি নোটিশ আপনার সামনে আসবে। এখানে <strong>&quot;Start Attempt&quot; </strong>বাটনে ক্লিক করুন, এবং পরীক্ষায় অংশগ্রহণ করুন।</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>৩।</strong>&nbsp;আপনার জন্য নির্ধারিত প্রশ্নগুলি আপনার সামনে আসবে। সঠিক উত্তরগুলিতে ক্লিক করে নির্বাচন করুন।&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>৪।</strong>&nbsp;সকল প্রশ্নের উত্তর দেওয়া হয়ে গেলে নীচের <strong>&quot;Finish Attempt&quot;</strong> নামক বাটনে ক্লিক করুন।</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>৫।</strong>&nbsp;এরপর আপনাকে একটি <strong>&quot;Summary of attempt&quot;</strong> দেখাবে, যেখানে আপনার কোন কোন প্রশ্নের উত্তর সেভ হয়েছে তা দেখাবে, যদি কোন প্রশ্নের উত্তর সেভ না হয় তবে <strong>&quot;Return to attempt&quot;</strong> বাটনে ক্লিক করে তা দিয়ে আসতে পারবেন। সকল প্রশ্নের উত্তর নির্ধারিত সময়ের মধ্যে দেওয়া হয়ে গেলে নীচের <strong>&quot;Submit all and finish&quot;</strong> বাটনে ক্লিক করুন।</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>৬।</strong>&nbsp;এরপর আপনার কাছ থেকে একটি কনফারমেশান চাইবে যে আপনি উত্তরপত্রটি সাবমিট করতে চান কিনা, এখানে পুনরায় <strong>&quot;Submit all and finish&quot; </strong>বাটনে ক্লিক করুন, আপনার উত্তর পত্রটি সাবমিট হয়ে যাবে এবং আপনাকে একটি <strong>Preview </strong>পেজ দেখাবে যেখানে আপনার পরীক্ষায় অংশগ্রহণের সময়, পরীক্ষাটি শেষ করার জন্য কতক্ষণ লেগেছে, এবং এই পরীক্ষায় আপনি কত নম্বর পেয়েছেন তা দেখাবে। একই সাথে আপনার&nbsp;সকল প্রশ্নের সঠিক উত্তর আপনাকে দেখাবে। অর্থাৎ আপনার পরীক্ষা দেওয়া শেষ হয়েছে।</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>৭।</strong>&nbsp;এবার সব নীচের<strong> &quot;Finish review&quot; </strong>বাটনে ক্লিক করুন, এবং মূল কোর্স পেজে ফেরৎ গিয়ে আবার নতুন পরীক্ষা শুরু করুন।&nbsp;অথবা পরীক্ষা খারাপ হয়ে থাকলে আবার পরীক্ষা দিন।</p>', '1620026107-MCQ.png', '', 1, '2021-05-03 07:15:07', '2022-06-23 10:21:29', NULL, 1, 112, NULL),
(24, 'লিখিত পরীক্ষা দেওয়ার নিয়মাবলী', '<p>এসব পরীক্ষায়&nbsp;অংশগ্রহণ করেছেন আপনার মেধা যাচাই করার জন্য। দয়া করে নকল করে বা কারও সাহায্য নিয়ে পরীক্ষাটি দিবেন না, কারণ এতে আপনি নিজেই ক্ষতিগ্রস্থ হবেন&nbsp;এবং&nbsp;আপনার মেধা সঠিক ভাবে যাচাই করা হবে না। তাই আপনি নিজেই পরীক্ষাটি দেওয়ার চেষ্টা করবেন। যদি খারাপ হয় তবে পুনরায় পরীক্ষা দেবার সুযোগ থাকছে।</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>লিখিত পরীক্ষা দেওয়ার নিয়মাবলীঃ</strong></h3>\r\n\r\n<p><strong>১।</strong>&nbsp;পরীক্ষা কেন্দ্রে পরীক্ষার নামের উপর ক্লিক করুন যেমন: <strong>&quot;লিখিত প্রশ্ন - ১&quot;</strong>। এরপর যে পেজটি আসবে সেখানে পরীক্ষাটি কতদিন চালু থাকবে এবং আপনি শুরু করার পর কতক্ষণের মধ্যে তা শেষ করতে হবে তা বিস্তারিত বর্ণণা দেওয়া থাকবে।</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>২।</strong>&nbsp;এবার <strong>&ldquo;Attempt quiz now&quot;</strong> নামক বাটনে ক্লিক করুন, এবং পরীক্ষায় অংশগ্রহণ সংক্রান্ত একটি নোটিশ আপনার সামনে আসবে। এখানে <strong>&quot;Start Attempt&quot; </strong>বাটনে ক্লিক করুন, এবং পরীক্ষায় অংশগ্রহণ করুন।</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>৩।</strong>&nbsp;এবার আপনার জন্য নির্ধারিত প্রশ্নটি আপনার সামনে আসবে। এখানে প্রশ্নের উত্তর দেওয়ার দুই ধরণের সুবিধা আছে।</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>সুবিধা ১:</strong> প্রশ্নের ঠিক নিচেই থাকবে <strong>&ldquo;টাইপ&rdquo; </strong>করে উত্তর দেবার জন্য একটি টেক্সট এডিটর। এখানে আপনি সরাসরি টাইপ করে উত্তর দিতে পারবেন।&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>সুবিধা ২:</strong> আপনি প্রশ্ন দেখে উত্তরটি আপনার খাতায় লিখুন। এরপর উত্তরপত্রের ছবি টেক্সট এডিটর এর নিচের ফাইল আপলোড এর অপশন থেকে আপনার ফাইলটি আপলোড করুন।&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>৪।</strong>&nbsp;উত্তর পত্র আপলোড করা হয়ে গেলে নীচের <strong>&quot;Finish Attempt&quot;</strong> নামক বাটনে ক্লিক করুন।&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>৫।</strong>&nbsp;এরপর আপনাকে একটি <strong>&quot;Summary of attempt&quot;</strong> দেখাবে, যেখানে আপনার কোন কোন প্রশ্নের উত্তর সেভ হয়েছে তা দেখাবে, যদি কোন প্রশ্নের উত্তর সেভ না হয় তবে <strong>&quot;Return to attempt&quot; </strong>বাটনে ক্লিক করে তা দিয়ে আসতে পারবেন। সকল প্রশ্নের উত্তর নির্ধারিত সময়ের মধ্যে দেওয়া হয়ে গেলে নীচের <strong>&quot;Submit all and finish&quot; </strong>বাটনে ক্লিক করুন।</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>৬।</strong>&nbsp;এরপর আপনার কাছ থেকে একটি কনফারমেশান চাইবে যে আপনি উত্তরপত্রটি সাবমিট করতে চান কিনা, এখানে পুনরায় <strong>&quot;Submit all and finish&quot; </strong>বাটনে ক্লিক করুন, আপনার উত্তর পত্রটি সাবমিট হয়ে যাবে এবং আপনাকে একটি <strong>Preview </strong>পেজ দেখাবে যেখানে আপনার পরীক্ষায় অংশগ্রহণের সময়, পরীক্ষাটি শেষ করার জন্য কতক্ষণ লেগেছে তা দেখাবে। লিখিত প্রশ্নের নম্বর শিক্ষক দেবার পর আপনার গ্রেডবুকে সরাসরি যুক্ত হবে এবং তা আপনি দেখতে পারবেন। আপনার পরীক্ষাটি দেওয়া শেষ হয়েছে।</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>৭।</strong>&nbsp;এবার সব নীচের <strong>&quot;Finish review&quot; </strong>বাটনে ক্লিক করুন, এবং মূল&nbsp;পেজে ফেরৎ গিয়ে আবার নতুন পরীক্ষা শুরু করুন।</p>', '1620026262-Written-exam.png', '', 1, '2021-05-03 07:17:42', '2022-05-09 06:51:40', NULL, 1, 1, NULL),
(25, 'রেফার কোড ব্যবহারের সুবিধা', '<p>এক্সামলীতে নতুন রেজিস্ট্রেশানকারীগণ প্রত্যেকে একটি রেফার কোড পাবেন । পূর্বের এক্সামলী ব্যবহারকারির রেফার কোডটি নতুন রেজিস্ট্রেশানকারী ব্যক্তি রেজিস্ট্রেশান করার সময় ব্যবহার করলে উক্ত রেফার কোডধারী ব্যক্তি এক্সামলীর পক্ষ থেকে ৯০ টাকা ক্যাশব্যাক পুরষ্কার পাবেন এবং আপনিও আপনার রেফার কোডটি শেয়ার করলে এবং আপনার রেফার কোডটি অন্য কেউ রেজিস্ট্রেশান করার সময় ব্যবহার করলে আপনিও ৯০ টাকা ক্যাশব্যাক পুরষ্কার পাবেন । এই ক্যাশব্যাক পুরষ্কারটি আপনি বিকাশ, রকেট, নগদ ও ব্যাংক অ্যাকাউন্টের মাধ্যমে নিতে পারবেন । ইউজার ড্যাশবোর্ডের রেফার কোডের ওপর ক্লিক করে কোন মাধ্যমে ক্যাশব্যাক পুরষ্কারটি নিতে চান তা উল্লেখ করে দিলে সেই মাধ্যমে ক্যাশব্যাক পুরষ্কারটি পাবেন । রেফার কোড ব্যবহারের পরবর্তী ৭ কার্যদিবসের মধ্যে ক্যাশব্যাক পুরষ্কারটি পাওয়া যাবে । রেফার কোড ব্যবহারের সময় ইউজার বানানগত বা অন্য কোন ভুল করলে রেফার কোড শেয়ারকারী ব্যক্তি ক্যাশব্যাক পুরষ্কারটি পাবেন না ।&nbsp;</p>', '1652949620-cashback.jpg', '', 0, '2022-05-19 08:40:20', '2022-05-19 08:40:20', NULL, 1, NULL, NULL);
